import { createRouter, createWebHashHistory } from "vue-router";
import Layout from '../views/Layout/index.vue'
const routes = [
    {
        path: "/",
        redirect: "Login",
        name: true,
        meta: {
            hidden: false
        }
    },
    {
        path: "/login",
        name: "Login",
        name: true,
        meta: {
            hidden: false
        },
        component: () => import("../views/Login/index.vue")
    },
    {
        path: "/layout",
        name: "Layout",
        meta: {
            title: "控制台",
            icon: "console",
            iconClass: "icon_console",
            hidden: true
        },
        component: Layout,
        children: [
            {
                path: "/home",
                name: "Home",
                meta: {
                    title: "首页",
                    hidden: false
                },
                component: () => import("../views/Home/index.vue"),
            }
        ]
    },
    {
        path: "/info",
        name: "Info",
        meta: {
            title: "测试",
            icon: "console",
            iconClass: "icon_console",
            hidden: true
        },
        component: Layout,
        // children: [
        //     {
        //         path: "/home",
        //         name: "Home",
        //         meta: {
        //             title: "首页",
        //             hidden: false
        //         },
        //         component: () => import("../views/Home/index.vue"),
        //     },{
        //         path: "/home",
        //         name: "Home",
        //         meta: {
        //             title: "首页1",
        //             hidden: false
        //         },
        //         component: () => import("../views/Home/index.vue"),
        //     }
        // ]
    }
];

const router = createRouter({
    history: createWebHashHistory(),
    routes,
});

export default router;
